import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import NikeAir from './img/Nike-Air.png'
// import NikeAirMax from '../../img/Nike-air-max.png'
// import NikeAntiClog from '../../img/Nike-Anti-Clog.png'
// import NikeFlyease from '../../img/Nike-Flyease.png'
// import NikeFlyknit from '../../img/Nike-Flyknit.png'
// import NikeKD14 from '../../img/tenis-nike-kd14.png'
//Importar as páginas
import Cadastro from './pages/Cadastro';
import Main from './pages/Main';
import Lancamentos from './pages/Lançamentos';
import Feminino from './pages/Feminino';
import Masculino from './pages/Masculino';
import Infantil from './pages/Infantil';


//Criar o componentes com as rotas
function Routes(){
    const calcados = [
        {
          id:1,
          nome:"Nike Air",
          modelo:'Masculino',
          preco:499
        },
        {
          id:2,
          nome:"Nike Air Max",
          modelo:'Feminino',
          preco:450
        },
        {
          id:3,
          nome:"Nike Anti-Clog",
          modelo:'Infantil',
          preco:400
        },
        {
          id:4,
          nome:"Nike Flyease",
          modelo:'Feminino',
          preco:430
        },
        { 
          id:5,
          nome:"Nike Flyknit",
          preco: 350
        },
        { 
          id:6,
          nome:"Nike KD14",
          preco:380
        }  

      ]
    return(
        <BrowserRouter>
            <Switch>
                <Route path="/" exact render={(props) => <Main {...props} calcados={calcados} />}/>
                <Route path="/cadastro" component={Cadastro} />
                <Route path="/lancamentos" component={Lancamentos} />
                <Route path="/feminino" render={(props) => <Feminino {...props} calcados={calcados} />} />
                <Route path="/masculino" component={Masculino} />
                <Route path="/infantil" component={Infantil} />

            </Switch>        
        </BrowserRouter>
    );
};

export default Routes;
